data.alert_description:
On {{trigger_date}}, Deepwatch was alerted to a log manipulation event. "{{user}}" was seen performing activity that triggered an alert for {{signature}} on {{dest}}. Log clearing may be an indicator that a malicious actor is attempting to hide their presence and any actions they may have taken. 

User: {{user}} 
Destination: {{dest}} 
Event Code: {{signature_id}} {{signature}} 
Object: {{object}} 
Message: {{Message}} 

The alert searches the following events for log clearing activity: 
-System Code 104 or Security Codes 1102 or 517, AND 
-"LogFileCleared" or "clear" in the Task Category or action field.
